import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Sidebar from "./srcdash/components/Sidebar";
import Dashboard from "./srcdash/components/Dashboard";
import Students from "./srcdash/components/Students";
import Teachers from "./srcdash/components/Teachers";

const AppDash = () => {
  return (
    <Router>
      <div className="flex">
        <Sidebar />
        <div className="flex-1 p-6">
          <Routes>
            <Route path="/Dashboard" element={<Dashboard />} />
            <Route path="/students" element={<Students />} />
            <Route path="/teachers" element={<Teachers />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
};

export default AppDash;
